 import React, {Component, Fragment} from 'react';
 import {
   HeaderWrapper
 } from './style';

 class Header extends Component {
   render() {
     return (
       <Fragment>
        <HeaderWrapper>header</HeaderWrapper>
       </Fragment>
     )
   }
 }

 export default Header;
